import './App.css';

class App extends Component {

  componentDidMount() {
    fetch('http://127.0.0.1:1812/')
        .then(Response => Response.json())
        .then(console.log)
  }

  render() {
    return (
      <div className="App">

      </div>
    );
  }
}

export default App;
